import React, {Component} from 'react';
import {
  View,
  Text,
  Image,
  StyleSheet,
  ScrollView,
  ListView,
  ActivityIndicator
} from 'react-native';

import Take from './search/take';
import styles from '../styles/reba.js';
import Swiper from 'react-native-swiper2';
import URL from '../common/url';

export default class JokerList extends Component{
    constructor(props){
      super(props);
      this.fetchData();

      this.state = {
        isLoading:false,
        rebaList: new ListView.DataSource({rowHasChanged: (r1, r2) => r1 !== r2})
      }
    }
    fetchData(){
      fetch(URL.rebaList)
        .then(response => response.json())
        .then(responseData => {

          this.setState({
            rebaList:this.state.rebaList.cloneWithRows(responseData),
            isLoading:true
          });

        })
        .done();
    }
    renderRebaList(item){

        return <Take navigator={1} information={item}/>
    }
  render(){
    const img1='data:image/jpg;base64,';
    const img2='data:image/jpg;base64,';

    if(!this.state.isLoading){
      return (
        <View style={{
          backgroundColor: '#eae7ff',
          flex: 1
        }}
        >
          <View style={{
            flex: 1,
            alignItems: 'center',
            justifyContent: 'center'
          }}>
            <ActivityIndicator
              size="large"
            />
          </View>
        </View>
      )
  }else {
    return (
        <View style={styles.container} nav={2}>
          <ScrollView style={{flex:1}}>
            <View style={styles.swiper_box}>
              <Swiper style={styles.wrapper} showsPagination={false}>
                <View style={styles.slide1}>
                  <View style={styles.image_box}>
                    <Image style={styles.image} source={{uri:img1}}/>
                    <Text style={styles.image_text}>天蝎宝宝嗨起来~</Text>
                  </View>
                </View>

                <View style={styles.slide2}>
                  <View style={styles.image_box}>
                    <Image style={styles.image} source={{uri:img2}}/>
                    <Text style={styles.image_text}>二次元情感故事,暖暖的治愈,暖暖的爱~</Text>
                  </View>
                </View>

              </Swiper>

            </View>

            <ListView
              dataSource={this.state.rebaList}
              renderRow={this.renderRebaList}
           >
           </ListView>
         </ScrollView>
        </View>
    );
   }
  }
}
